export const actions = {
	openLightboxAction: (slideNumber: number) => {
		return ({
			type: 'OPEN_LIGHTBOX',
			slideNumber
		});
	},
	closeLightboxAction: () => ({
		type: 'CLOSE_LIGHTBOX'
	}),
};
